    {%- elif rule == "append_distinct" -%}
        {{ col.quoted }} = {{ 'array_distinct(src.' + col.quoted + ' || target.' + col.quoted + ')' }}
    {%- elif rule == "replace" -%}
        {{ col.quoted }} = {{ 'src.' + col.quoted }}
    {%- else -%}
        {{ col.quoted }} = {{ rule | replace("_new_", 'src.' + col.quoted) | replace("_old_", 'target.' + col.quoted) }}
    {%- endif -%}
    {{ "," if not is_last }}
